import React from 'react';

function ProductList({ products, onSelect }) {
  return (
    <div>
      {products.map((product) => (
        <div key={product.id} onClick={() => onSelect(product)}>
          {product.name} - {product.code}
        </div>
      ))}
    </div>
  );
}

export default ProductList;
